// UserProfile.js

import React from "react";
import { useLocation } from "react-router-dom";

const UserProfile = () => {
  const location = useLocation();
  const { Data } = location.state;

  return (
    <div>
      <h2>User Profile</h2>
      <img src={Data.photo_url} height="250px" width="250px" />
      <p>Roll Number: {Data.roll_number}</p>
      <p>Student Name: {Data.student_name}</p>
      <p>Email id: {Data.email_id}</p>
      <p>address: {Data.address}</p>
      <p>Contact Number :{Data.contact_number}</p>
      <p>School of Study:{Data.school_of_study}</p>
       year_of_admission : 2023
    </div>
  );
};

export default UserProfile;
